import React, { Fragment } from 'react';
import Pontuacion from './components/pontuacion/Score';
import Triangle from './components/original/triangle/Triangle';
import Pentagon from './components/bonus/Pentagon/Pentagon';



function App() {
  const position = document.querySelector('#root').dataset.position

  return (
    <Fragment>
      <Pontuacion 
        position={position}
      />
      <Pentagon  
        position={position}
      />
      <Triangle  
        position={position}
      />
    </Fragment>
  );
}

export default App;
